import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faBriefcase, faUser, faNewspaper } from '@fortawesome/free-solid-svg-icons';

const Header = () => {
  const headerStyle = {
    position: 'fixed',
    top: 0,
    left: 0,
    width: '100%',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '20px',
    backgroundColor: 'rgb(48, 40, 57)',
    textAlign: 'center',
    borderBottomLeftRadius: '20px',
    borderBottomRightRadius: '20px',
  };

  const linkStyle = {
    color: '#fff',
    textDecoration: 'none',
    margin: '0 8px', // Adjust the margin to reduce space between buttons
    fontSize: '16px',
  };

  return (
    <header style={headerStyle}>
      <a href='/' style={linkStyle}><FontAwesomeIcon icon={faHome} /> Home</a>
      <a href='/projects' style={linkStyle}><FontAwesomeIcon icon={faBriefcase} /> Projects</a>
      <a href='/aboutme' style={linkStyle}><FontAwesomeIcon icon={faUser} /> About Me</a>
      <a href='http://localhost:8000' style={linkStyle}><FontAwesomeIcon icon={faNewspaper} /> Blog</a>
    </header>
  );
};

export default Header;


